import Chat from "./MainSelectChat";

function LeftPanel({ chats, filter }) {
    if (chats === null) return;

    console.log(chats);

    let data = filter === null ? chats : Object.fromEntries(Object.entries(chats).filter(([_, value]) => {
        console.log(value.interlocutor);
        // filter.test(value.interlocutor.username)
    }));

    return (
        <>
            {
                Object.entries(data).map(({key, value}) => <Chat key={key} data={value}/>)
            }
        </>
    )
}

export default LeftPanel;
